import React, { Component } from 'react';
import todoData from './TodoData';
import { ToDoItem } from "./ToDoItem";


export class Body extends Component {
    constructor() {
        super();
        this.state = {
            todoData: todoData,
        };
        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(id) {
        this.setState(prevState => {
            return {
                todoData: prevState.todoData.map(t => {
                    t.id == id ? !t.completed : t.completed;
                    console.log(t);
                }

                    // t.id == id ? !t.completed : t.completed
                )

            }
        })
    }

    render() {
        const todoComponents = this.state.todoData.map(
            todo => <ToDoItem text={todo.text} completed={todo.completed} onClick={this.handleChange}/>);

        return (<div className="content">
            <h2 className="heading">These are my to do</h2>
            {todoComponents}
        </div>);
    }
}
